import React from "react";
import "./Coin.css";
import headsImage from "/"; // Import heads image
import tailsImage from "./tails.png"; // Import tails image

function Coin({ side }) {
  const imageSrc = side === "heads" ? headsImage : tailsImage;

  return (
    <div className={`Coin ${side}`}>
      <img src={imageSrc} alt={side} />
    </div>
  );
}

export default Coin;
